import{_ as n,c as t,a0 as r,o as a}from"./chunks/framework.p2VkXzrt.js";const m=JSON.parse('{"title":"About Me","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"about.md","filePath":"about.md"}'),i={name:"about.md"};function o(s,e,d,u,h,l){return a(),t("div",null,e[0]||(e[0]=[r('<h1 id="about-me" tabindex="-1">About Me <a class="header-anchor" href="#about-me" aria-label="Permalink to &quot;About Me&quot;">​</a></h1><h2 id="introduction" tabindex="-1">Introduction <a class="header-anchor" href="#introduction" aria-label="Permalink to &quot;Introduction&quot;">​</a></h2><p>I am a passionate, adaptable, and creative problem solver adept at navigating change. I demonstrate exibility and innovation in diverse environments. My aim is to build a career that oers challenges and growth opportunities to enrich my knowledge and skills while contributing my best to the organization I work for. I graduated from Holy Cross of Davao College, where I earned my Bachelor of Science in Information Technology. Throughout my studies, I developed a strong foundation in various aspects of IT, including programming, database management, and network security. The rigorous curriculum and hands-on projects allowed me to enhance my technical skills and prepare for a successful career in the ever-evolving field of information technology. I am grateful for the education and experiences I gained at HCDC, which have equipped me to tackle real-world challenges in the tech industry.</p><h2 id="contact-me" tabindex="-1">Contact Me <a class="header-anchor" href="#contact-me" aria-label="Permalink to &quot;Contact Me&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">Email</p><ul><li><a href="mailto:punpunsx00@gmail.com" target="_blank" rel="noreferrer">punpunsx00@gmail.com</a></li><li><a href="mailto:darkcreepy20@gmail.com" target="_blank" rel="noreferrer">darkcreepy20@gmail.com</a></li></ul></div><h3 id="discord" tabindex="-1">Discord <a class="header-anchor" href="#discord" aria-label="Permalink to &quot;Discord&quot;">​</a></h3><div class="language-discord vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">discord</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>punpunsx00</span></span></code></pre></div><h2 id="german-stories" tabindex="-1"><a href="https://www.thegermanproject.com/" target="_blank" rel="noreferrer">German Stories</a> <a class="header-anchor" href="#german-stories" aria-label="Permalink to &quot;[German Stories](https://www.thegermanproject.com/)&quot;">​</a></h2><h3 id="rotkappchen-little-riding-hood" tabindex="-1">Rotkäppchen (Little Riding Hood) <a class="header-anchor" href="#rotkappchen-little-riding-hood" aria-label="Permalink to &quot;Rotkäppchen (Little Riding Hood)&quot;">​</a></h3><p>Es war einmal, inmitten eines dichten Waldes, ein kleines Haus, wo ein hübsches kleines Mädchen namens Rotkäppchen wohnte. Eines sonnigen Tages rief die Mutter sie in die Küche von ihrem kleinen Haus.</p><p>&quot;Großmutter ist krank&quot;, sagte sie. &quot;Bring ihr diesen Korb mit Kuchen, aber sei sehr vorsichtig! Bleib auf dem Pfad in dem Wald und bleib nicht stehen! Wenn du schnell läufst, wird dir nichts passieren.&quot;</p><p>&quot;Sorge dich nicht&quot;, sagte sie. &quot;Ich werde zur Großmutter laufen, ohne stehen zu bleiben.&quot; Rotkäppchen küsste ihre Mutter und lief los. Das kleine Mädchen begann ihre lange Reise durch den Wald.</p><p>Aber sie vergaß schon bald die weisen Worte ihrer Mutter. Sie sah einen Brombeerstrauch neben dem Pfad. &quot;Was für hübsche Brombeeren!&quot;, rief sie und legte ihren Korb auf den Boden. &quot;Sie sind so schön und reif…und so groß! Köstlich! Ich nehme mir vielleicht nur noch eine…&quot; Plötzlich erinnerte sich Rötkäppchen an ihre Mutter, ihr Versprechen, ihre Großmutter und den Korb… Sie lief schnell zu dem Pfad zurück.</p><p>Der Wald wurde dichter und dichter. Ein gelber Schmetterling flog durch die Bäume. &quot;Oh, wie hübsch!&quot;, rief sie. Und sie jagte den Schmetterling durch die Bäume. &quot;Ich fange dich!&quot; Dann sah sie lila Blumen im Gras. &quot;Oh, wie schön!&quot; rief sie. &quot;Großmutter wird sich darüber freuen!&quot;. Und sie pflückte einen riesigen Strauß Blumen.</p><p>Währenddessen beobachteten sie zwei bedrohliche Augen von hinter einem Baum. Ein seltsames Geräusch im Wald erschreckte Rotkäppchen und ihr Herz begann zu pochen. &quot;Ich muss den Pfad finden und schnell von hier weg laufen!&quot; Rotkäppchen rannte und rannte und fand schließlich den Pfad. Aber sobald sie sich beruhigte, hörte sie wieder ein seltsamen Geräusch hinter sich...</p><p>... Eine sehr tiefe Stimme sagte: &quot;Hallo, kleines Mädchen. Warum läufst du ganz alleine durch den Wald? Wo gehst du hin?&quot; &quot;Ich bringe Kuchen zu meiner Großmutter. Sie wohnt am Ende von diesem Pfad,&quot; sagte Rotkäppchen mit einer ganz leisen Stimme. &quot;Wohnt deine Großmutter alleine?&quot;, fragte der Wolf (denn es war der Große Böse Wolf mit dem sie sprach!) &quot;Oh, ja&quot;, antwortete Rotkäppchen, &quot;und sie öffnet Fremden niemals die Tür!&quot;</p><p>&quot;Du hast eine sehr schlaue Großmutter,&quot;, antwortete der Wolf. &quot;Es war schön mit dir zu sprechen. Vielleicht werden wir uns wieder begegenen!&quot; Der Wolf lief los und dachte &quot;Hmmmm, ich werde zuerst die Großmutter fressen und dann auf das kleine Mädchen warten.&quot; Der Wolf kam am Ende des Pfades an, wo das kleine Haus stand. Klopf! Klopf! Der Wolf klopfte an die Tür.</p><p>&quot;Wer ist da?&quot;, rief Großmutter von ihrem Bett aus. &quot;Ich bin es, Rotkäppchen. Ich bringe dir Kuchen, weil du krank bist,&quot; antwortete der Wolf und bemühte sich, seine tiefe Wolf-Stimme zu verbergen. &quot;Oh, wie wunderbar!&quot;, sagte die Großmutter. Sie hat nichts seltsames bemerkt. &quot;Komm herein!&quot;</p><p>Arme Großmutter! In weniger als zwei Sekunden sprang der Wolf durch das Zimmer und verschlang die alte Dame. Schluck! Dann zog der Wolf Großmutters Kleid und Hut an und legte sich ins Bett. Schon bald klopfte Rotkäppchen an die Tür. &quot;Großmutter, ich bin&#39;s. Kann ich herein kommen? Der Wolf versuchte Großmutters feine Stimme zu imitieren und antwortete, &quot;Hallo, mein Kind! Komm herein!&quot;</p><p>&quot;Was für eine tiefe Stimme du hast Großmutter!&quot;, sagte das kleine Mädchen überrascht. &quot;Damit ich dich besser begrüßen kann, mein Kind&quot;, sagte der Wolf. &quot;Und was für große Augen du hast, Großmutter...&quot; &quot;Damit ich dich besser sehen kann, mein Kind!&quot; &quot;Und was für große Hände du hast!&quot;, rief Rotkäppchen und ging auf das Bett zu. &quot;Damit ich dich besser umarmen kann, mein Kind!&quot; sagte der Wolf.</p><p>&quot;…Und was für einen großen Mund du hast,&quot; murmelte das kleine Mädchen mit einer schwachen Stimme. &quot;Damit ich dich besser FRESSEN kann!&quot;, knurrte der Wolf und sprang aus dem Bett und verschlang sie auch. Dann ist er mit vollem Magen eingeschlafen.</p><p>In diesem Moment kam ein Jäger aus dem Wald. Er sah das Haus und beschloss dort stehen zu bleiben und nach einem Glas Wasser zu fragen. Er suchte nach einem großen Wolf, der Schafe aus dem Dorf gestohlen hat.</p><p>Der Jäger hörte ein seltsames Pfeifen in dem Haus. Er schaute durch das Fenster und sah den großen Wolf schnarchend im Bett der Großmutter liegen. &quot;Der Wolf! Diesmal wird er mir nicht entkommen!&quot; Vorsichtig und leise schlich der Jäger in das Häuschen. Als er auf das Bett zuging, hörte er ein kleines Mädchen weinen… und das Geräusch kam aus dem Magen des Wolfes! Der Jäger schnitt mit seinem Messer den Magen des Wolfes auf und heraus kamen Rotkäppchen und ihre Großmutter, heil und gesund.</p><p>Der Jäger füllte den Magen des Wolfes mit Steinen aus dem Garten und nähte ihn dann wieder zu. Als der Wolf aufwachte und den Jäger sah, rannte er so schnell er konnte weg. Die großen Steine haben ihm solch Bauchschmerzen gegeben, dass er Vegetarier wurde und das Dorf für immer in Ruhe gelassen hat.</p><p>&quot;Es ist jetzt sicher, nach Hause zu gehen&quot;, sagte der Jäger zu Rotkäppchen. &quot;Der große böse Wolf ist weg, auf dem Pfad lauert keine Gefahr mehr.&quot; Rotkäppchens Mutter kam an dem Haus der Großmutter an, als die Sonne unterging. Sie hat sich Sorgen gemacht, als ihre Tochter nicht nach Hause kam. Als sie Rotkäppchen sah, brach sie in Freundentränen aus. &quot;Oh, dir geht es gut!&quot;</p><p>Nachdem sie sich noch einmal bei dem Jäger bedankt haben, sind Rotkäppchen und ihre Mutter durch den Wald nach Hause gelaufen. Als sie schnell durch den Wald liefen, sagte das kleine Mädchen zu ihrer Mutter: &quot;Wir müssen immer auf dem Pfad bleiben und niemals stehen bleiben. Wenn wir das machen, wird uns nichts passieren.&quot;</p><h2 id="more-to-come" tabindex="-1">More to come ... <a class="header-anchor" href="#more-to-come" aria-label="Permalink to &quot;More to come ...&quot;">​</a></h2>',27)]))}const p=n(i,[["render",o]]);export{m as __pageData,p as default};
